import React from "react";
import Labrator from "../Images/Labrator.jpg";
import Pug from "../Images/Pug.jpg";
import Rot from "../Images/Rot.jpg";
import Beagle from "../Images/Beagle.jpg";
import Germanshepard from "../Images/Germanshepard.jpg";
import Golden from "../Images/Golden.jpg";
import { Button } from "react-bootstrap";


function Ourproducts() {
    return (
        <div style={{ padding: "40px" }} className="row">

            <div className="col-xxl-4 col-xl-4 col-md-6 col-sm-12 d-flex flex-column" style={{ padding: "40px" }}>
                <img style={{ width: "300px", height: "300px", marginBottom: "10px" }} src={Labrator} alt="Labrator" />
                <Button className="btn btn-primary" style={{ width: "50%" }}>LABRATOR-RS.12,000</Button>

            </div>

            <div className="col-xxl-4 col-xl-4 col-md-6 col-sm-12 d-flex flex-column" style={{ padding: "40px" }}>
                <img style={{ width: "300px", height: "300px" }} src={Pug} alt="Pug" />
                <Button className="btn btn-primary" style={{ width: "50%" }}>PUG-RS.18,000</Button>
            </div>

            <div className="col-xxl-4 col-xl-4 col-md-6 col-sm-12 d-flex flex-column" style={{ padding: "40px" }}>
                <img style={{ width: "300px", height: "300px" }} src={Rot} alt="Rot" />
                <Button className="btn btn-primary" style={{ width: "50%" }}>ROTTWEILDER-RS.15,000</Button>
            </div>

            <div className="col-xxl-4 col-xl-4 col-md-6 col-sm-12 d-flex flex-column" style={{ padding: "40px" }}>
                <img style={{ width: "300px", height: "300px" }} src={Beagle} alt="Beagle" />
                <Button className="btn btn-primary" style={{ width: "50%" }}>BEAGLE-RS.19,000</Button>
            </div>

            <div className="col-xxl-4 col-xl-4 col-md-6 col-sm-12 d-flex flex-column" style={{ padding: "40px" }}>
                <img style={{ width: "300px", height: "300px" }} src={Germanshepard} alt="German Shepherd" />
                <Button className="btn btn-primary" style={{ width: "50%" }}>GERMAN SHEPHERD-RS.14,000</Button>
            </div>

            <div className="col-xxl-4 col-xl-4 col-md-6 col-sm-12 d-flex flex-column" style={{ padding: "40px" }}>
                <img style={{ width: "300px", height: "300px" }} src={Golden} alt="Golden Retriever" />
                <Button className="btn btn-primary" style={{ width: "50%" }}>GOLDEN RETRIEVER-RS.12,000</Button>

            </div>
        </div >
    );
}

export default Ourproducts;
